	add("codpiece", "{\"term\":\"codpiece\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{compound|cod|t1\u003dscrotum|piece|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A part of male dress in front of the breeches to cover the male genitals, sometimes made very conspicuous in former times\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Act III, Scene III, line 130\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Borachio: Seest thou not, I say, what a deformed thief this fashion is, how giddily ’a turns about all the hot-bloods between fourteen and five-and-thirty, sometimes fashioning them like Pharaoh’s soliders in the reechy painting, sometime like god Bel’s priests in the old church-window, sometime like the shaven Hercules in the smirch’d worm-eaten tapestry, where his \u0027\u0027codpiece\u0027\u0027 seems as massy as his club\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A conspicuous protection for the male genitals in a suit of plate armor\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1786\u0027\u0027, w:Francis Francis Grose, \u0027A Treatise on Ancient Armour and Weapons\u0027, page 21\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"On some suits were screwed large iron \u0027\u0027cod-pieces\u0027\u0027; these, according to tradition, were intended to prevent the ill consequences of those violent shocks received in charging, either in battle, or at a tournament. Same say, they were meant to contain sponges for receiving the water of knights, who in the heat of an engagement might not have any more convenient method of discharging it. But most probably, they were rather constructed in conformity to a reigning fashion in the make of the breeches of those times\", \"priority\":6}]}, \"synonyms\":{}}");

